import userActionConstants from './userActionConstants';

export const setCurrentUser = (user) =>( {
    type:userActionConstants.SET_CURRENT_USER,
    payload:user
})

export const googleSignInStart =()=>({
    type:userActionConstants.GOOGLE_SIGNIN_START
})

export const googleSignInSuccess =(user)=>({
    type:userActionConstants.GOOGLE_SIGNIN_SUCCESS,
    payload:user
})

export const googleSignInFailed =(error)=>({
    type:userActionConstants.GOOGLE_SIGNIN_FAILED,
    payload:error
})

export const emailSignInStart =()=>({
    type:userActionConstants.EMAIL_SIGNIN_START
})

export const emailSignInSuccess =(user)=>({
    type:userActionConstants.EMAIL_SIGNIN_SUCCESS,
    payload:user
})

export const emailSignFailed =(error)=>({
    type:userActionConstants.EMAIL_SIGNIN_FAILED,
    payload:error
})
